{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"3.6.0","file_extension":".r","codemirror_mode":"r"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":12492652,"sourceType":"datasetVersion","datasetId":7883634},{"sourceId":12492750,"sourceType":"datasetVersion","datasetId":7883711}],"dockerImageVersionId":30749,"isInternetEnabled":false,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/lwalker8264/bella-beats-capstone-project?scriptVersionId=291536689\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"code","source":"","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"---\ntitle: \"Bella_Beats_Capstone_DA\"\nauthor: \"Logan Walker\"\ndate: \"2025-07-11\"\noutput: html_document\n---\n\n![Bella_Beats_Cappie.png](attachment:710d346c-fd94-415b-9ed5-113ac1226bed.png)!\n\n\n\n## Table of Contents\n\n1. Summary\n\n2. Ask Phase\n- Business Task\n\n3. Prepare Phase\n\n- Data set used\n- Privacy of Data\n- Data Credibility and Integrity (ROCCC)\n\n4. Process Phase\n- View and Get to Know Data\n- Clean and Format Data\n- Combine Data Sets\n\n5. Analyze Phase\n- Explore sleepDay_merged_single df using visualization\n- Explore hourlySteps_merged_combined df using visualization\n- Explore DailyActivity_merged_combined df using visualization\n\n6. Share Phase\n- Correlation 1\n- Correlation 2\n- Increased Share ability\n\n7. Act Phase\n- Actionable Rec 1\n- Actionable Rec 2\n\n8. Conclusion\n\n## Summary\n To completely analyize the data set presented to us so that we can find correlations in the data then present our findings as actionable suggestions\nto the Bella Beats marketing team in order to refine and improve their marketing strategy.\n\n## Ask Phase\n ##Business task: Take the data of smart devices presented to us to clean and analyze then present our findings to Bella Beats marketing team as actionable suggestions.\n\nStakeholders\n\nUrška Sršen - Bellabeat cofounder and Chief Creative Officer\nSando Mur - Bellabeat cofounder and key member of Bellabeat executive team\nBellabeat Marketing Analytics team\n\n## Prepare Phase\n\n#Dataset Used\n\n The Data set we're going to be using for our case study is the FitBit Fitness Tracker Data\nA data set stored in Kaggle and made use able through Mobious\n\n#Privacy of Data\n By checking through the Metadata we can confirm that it's open-source\nThe owner of the data set has fully given it to the public domain\nThis link shows that: https://creativecommons.org/publicdomain/zero/1.0/\nAlso Kaggle is a highly trusted data based website that has given this data its own high rating of trust \nand integrity the rating is 9.41 out of 10 Making it a fairly trustworthy data source\n \n#Data Credibility and Integrity (ROCCC)\nR-reliable (9.41 of 10 Kaggle reliablility rating) (4 out of 5 Personal reliablility rating) \nO-original (Data set is shared through Kaggle) (Dataset originates from distributed survey via Amazon Mechanical Turk)\nc-comprehensive (Data is nearly comprehensive with only a few column descriptions missing)\nc-current (Is not current is 9 years old, from 2016) (While dated, data is good to use as an example Capstone project)\nc-cited (Is cited and is open source)\nAlso each participant has signed that they are willing to participate and share their data\nThe only thing is the sample size is only 30 people which isn't a very large sample size which decreases its viability\nAlso the demographics of the participants isn't shown so we can't be sure if the sample is represented properly\nAll things considered while the data set viability might not be perfect it is good enough to work with.\nI'd give this data set a rating of 4 out of 5\n \n## Process Phase\n \n First I upload a data frame using some code below.\n Next I'll run it through head function to get a quick look at the data\n When Importing the data make sure to ensure all the naming follows the same pattern if not rename the data\n so that it does follow the same pattern before hitting import.\n\n```{R Upload}\ndailyActivity_merged_4_11.csv <- read_csv(\"/kaggle/input/bella-beats-datasets/dailyActivity_merged_4_11.csv\")\n```\n```{R Upload}\ndailyActivity_merged_5_12.csv <- read_csv(\"/kaggle/input/bella-beats-datasets/dailyActivity_merged_5_12.csv\")\n```\n```{R Upload}\nHourlySteps_merged_combined.csv <- read_csv(\"/kaggle/input/bella-beats-datasets/HourlySteps_merged_combined.csv\")\n```\n```{R Upload}\nsleepDay_merged_single.csv <- read_csv(\"/kaggle/input/bella-beats-datasets/sleepDay_merged_single.csv\")\n```\n\n This  also be completed using the clean names function or the change to upper or lower functions.\n\n First we'll install and open all of the packages we'll be using.\n```{R install}\ninstall.packages(tidyverse)\n```\n```{R install}\ninstall.packages(ggplot2)\n```\n```{R library}\nlibrary(tidyverse)\n```\n```{R library}\nlibrary(ggplot2)\n```\n\n## Analyze Phase\n\n# View and Get to Know Data\n\n We're going to head all of the df's so we can get an idea of what we're looking at.\n```{R head}\nhead(dailyActivity_merged_4_11)\n```\n\n# Clean and Format Data\n\n Im going to apply a trim function the dataframe to clean up any white spaces\n```{R trim}\ndailyActivity_merged_4_11 %>%\n  mutate(across(where(is.character), str_trim))\n```\n Uploading a dataframe through the environment window is supposed to already trim excess space from the df\n However we'll run it through the codeline above just to be safe.\n\nNext we'll check all our dataframes for duplicates\n```{R duplicated}\nsum(duplicated(dailyActivity_merged_4_11))\n```\n Any duplicates that are found will be removed with the code below\n```{R remove duplicate}\ndailyActivity_merged_4_11 <- dailyActivity_merged_4_11 %>%\n  distinct() %>%\n  drop_na()\n```\n Then we'll run the sum(duplicated) code again to ensure any and all duplicates have been removed.\n\n Next I'll use the mdy_hms function to change the column a date time to the proper format.\n Using mdy_hms or a variation such as mdy that depends on how the time in the column is displayed.\n Currently it is formated as a Chr string.\n```{R format}\ndailyActivity_merged_4_11$ActivityDate <- mdy(dailyActivity_merged_4_11$ActivityDate)\n```\n We'll use the head function to ensure the proper columns formatting has been changed.\n```{R head}\nhead(dailyActivity_merged_4_11)\n```\n\n# Combine Data sets\n\n In this data set there are alot of data frames with two half separated by a month span of time.\n To make our observations easier we'll clean each corresponding df then combine them using this line of code.\n```{R bind}\ndailyActivity_merged_combined <- rbind(dailyActivity_merged_4_11, dailyActivity_merged_5_12)\n```\n We'll look to our environment window to ensure the number of observations have been combined.\n To be sure that the df's have been combined successfully we can look at the combined df through the head function.\n\n Next we'll remove the two data frames we combined to clean up our work space.\n```{R remove}\nremove(dailyActivity_merged_4_11, dailyActivity_merged_5_12)\n```\n\n We'll use the code written in this R script to rinse and repeat on the other df's in this dataset.\n \n# Explore correlations Using Visualization\n\n# Analyzation Attempt 1\n\n We'll be analyzing the sleepDay_merged_single df using ggplot2.\n  \n Now that the data is cleaned we'll begin exploring it in order to find useful trends.\n Firstly I'm going to check the sleepDay df in order to see if their are correlations between using these\n devices and getting better sleep\n```{R plot, echo=FALSE}\nggplot(data = sleepDay_merged_single, mapping = aes(x = TotalTimeInBed, y = TotalMinutesAsleep)) + geom_point()\n```\n![Sleep_merged_plot.png](attachment:f4384552-ebe9-4ddc-9df1-70ec544b1087.png)\n\n\n This code showed me a scatter plot of Time in Bed vs Total Minutes Asleep, which showed a positive correlation.\n \n unfortunately this is an expected trend that shouldn't be effected by the use of smart devices.\n So we'll explore a different df to continue our search.\n \n# Analyzation Attempt 2\n\n We'll be analyzing the hourlySteps_merged_combined df using ggplot2.\n\n```{R view}\nView(hourlySteps_merged_combined)\n```\n We're going to move to explore the Hourly Steps df in order to find out what times during the day are the      users\n Most active.\n```{R seperate}\nhourlySteps_merged_combined <- hourlySteps_merged_combined %>%\n  separate(ActivityHour, into = c(\"date\", \"time\"), sep= \" \") %>%\n  mutate(date = ymd(date))\n```\n```{R Convert}\nhourlySteps_merged_combined$time <- hms(hourlySteps_merged_combined$time)\n```\n```{R view}\nView(hourlySteps_merged_combined)\n```\n```{R character}\nhourlySteps_merged_combined$time <- as.character(hourlySteps_merged_combined$time)\n```\n We use the code above to separate the date and time of the ActivityHour Column\n We also change the new time column to the proper hms format.\n\n I'm going to use the code chunk below to add a new column containing the Average number of steps\n```{R column}\nhourlySteps_merged_combined <- hourlySteps_merged_combined %>% \n  +     mutate(Average_Steps = mean(StepTotal, na.rm = TRUE))\n```\n With the code chunk below we're going to create a bar chart with an x axis of the time by hour\n and with the y axis as the average number of steps\n We'll also add a title, and a gradient to help emphasize the scale of the average number of steps.\n Finally we'll rotate the x axis title to 90 degrees so that they don't collide with each other and are legible\n```{R plot, echo=FALSE}\nhourlySteps_merged_combined %>%\n  group_by(time_only) %>%\n  summarize(average_steps = mean(StepTotal)) %>%\n  ggplot() +\n  geom_col(mapping = aes(x=time_only, y = average_steps, fill = average_steps))+\n  labs(title = \"Daily Steps per Hour\", x=\"\", y=\"\") + \n  scale_fill_gradient(low = \"red\", high = \"green\")+\n  theme(axis.text.x = element_text(angle = 90))\n```\n\n![Daily Steps per Hour.png](attachment:eaae9538-c1de-42d5-8c7d-66bd910f694f.png)\n\n by viewing this ggplot we are able to see that that the majority of running happens during the day\n mainly between 8am and 6:30 pm with 6:30pm being the most active hour. \n\n Potentially because it's the time right after the average 9 to 5 worker gets home?\n \n# Analyzation Attempt 3\n\n We'll be analyzing the DailyActivity_merged_combined df using ggplot2.\n\n I use the code below to change the y axis so that it doesn't express Total Steps in scientific notation\n```{R notation}\n  scale_y_continuous(labels = function(x) format(x, scientific = FALSE)) +\n  scale_fill\n```\n I use the code below to take the weekends specifically out of the ActivityDate column.\n I do this so that use the weekend column as the fill in my ggplot so that I can more easily point out the \n the weekends in order to more easily emphasize the correlation.\n```{R wday}\ndailyActivity_merged_combined <- dailyActivity_merged_combined %>%\n  mutate(weekend = ifelse(wday(ActivityDate) %in% c(1, 7), \"Weekend\", \"Weekday\"))\n```\n \n By running the code chunk below we are able to view a column chart and see that the Saturdays are the most\n active consistently, followed by a consistent drop off of steps on Sunday.\n```{R plot, echo=FALSE}\nggplot(data = dailyActivity_merged_combined, aes(x = ActivityDate, y = TotalSteps, fill = weekend)) +\n  geom_col() +\n  scale_x_date(date_breaks = \"3 days\", date_labels = \"%d %b\") +\n  labs( title = \"Steps Over 2 Months\", x = \"April through May\", y = \"Number of Steps\") +\n  theme(axis.text.x = element_text(angle = 45, vjust = .55), axis.text.y = element_text(angle =45)) +\n  scale_y_continuous(labels = function(x) format(x, scientific = FALSE)) \n```\n\n![Steps Over 2 Months.png](attachment:7018f270-e938-426a-8eed-d236c2f86274.png)\n\n\n## Share\n\n#Correlation 1\n\n![Daily Steps per Hour.png](attachment:ff72c56a-af99-41a9-9465-b336271a806b.png)\n\n\n By viewing this ggplot we are able to see that that the majority of running happens during the day\n mainly between 8am and 6:30 pm with 6:30pm being the most active hour. \n Based on The average US worker's commute to and from work takes approximately 55.2 minutes \n (27.6 minutes each way), according to the U.S. Census Bureau. This includes both the time spent \n traveling to work and the time spent traveling home. \n A recent report from ActivTrak also indicates that office workers are clocking out around 4:39 PM on average. \n Considering the average commute time, the typical employee gets home around 5:12 PM.\n Considering this the marketing should focus on targeting workers coming home from work knowing that right\n after they get home is the time they will most likely get their steps or activity in.\n \n Citation of average commute https://www.census.gov/newsroom/press-releases/2021/one-way-travel-time-to-work-rises.html\n Citation of ActivTrak https://www.activtrak.com/resources/reports/state-of-the-workplace/\n \n# Correlation 2\n\n![Steps Over 2 Months.png](attachment:460f8790-989c-4e34-9638-e057cd7e7cae.png)\n\n  Using this Column plot below we're able to see that throughout the months of April and May\n People consistently almost twice the numbers of steps on the weekends than people did on a weekday\n Our marketing team should definitely increase their marketing efforts for the weekends knowing people are \n more willing to take efforts to increasing their health on the weekends.\n April 1st 2016 is a Friday.\n \n\n# Increased Share Ability \n Next we take our plots and transfer them to Tableau for easier viewing\n This is the link we'll use to view the plots on Tableau \n https://public.tableau.com/views/BellaBeatsDataPlotShowcase/Dashboard1?:language=en-US&:sid=&:redirect=auth&:display_count=n&:origin=viz_share_link\n\n##  Actionable recommendations\n\n# Actionable Rec 1\n\n 1. Viewing the Daily Steps per Hour plot generated using our data set we can see that activity is at its\n highest and most consistent at about 6:30 pm which according to average us commute via the us census bureau\n the average time a us employee gets home is about 5:12 pm suggesting that as soon as they get off work and\n are able to change and prepare they immediately get in their physical activity. \n With this is mind I suggest the marketing directs their efforts and timing of their marketing campaigns\n To target workers on their way home between 3 to 5 pm suggesting that right after work is the best time to \n get active and track their health.\n\n# Actionable Rec 2\n\n 2. Viewing the Steps over 2 Months plot we see that the weekends are consistently the most active days in terms\n of steps through out the 2 month period. With this is mind and knowing that the average worker generally\n has more free time on the weekends and is more likely to be active on the weekends.\n I suggest Urška Sršen, Sando Mur, and the Bella Beats marketing team\n direct our marketing efforts to target the weekends more heavily than the weekdays.\n \n## Conclusion\n Our recommendations is to continue gathering data specifically with our own devices so that we can have a more\n complete data set due to the small size and age of data set we are have currently , while increasing marketing  efforts to customers on the weekends and later in the evening around 6:30 pm.\n","metadata":{},"attachments":{"710d346c-fd94-415b-9ed5-113ac1226bed.png":{"image/png":""},"a2603528-dd74-4d98-8aea-85f09947c394.png":{"image/png":""},"f4384552-ebe9-4ddc-9df1-70ec544b1087.png":{"image/png":""},"eaae9538-c1de-42d5-8c7d-66bd910f694f.png":{"image/png":""},"7018f270-e938-426a-8eed-d236c2f86274.png":{"image/png":""},"ff72c56a-af99-41a9-9465-b336271a806b.png":{"image/png":""},"460f8790-989c-4e34-9638-e057cd7e7cae.png":{"image/png":""}}}]}